export let DisplayPokemons = ({pokemons}) => {
    if (pokemons === undefined) return
    return (
        <div >

            {pokemons.map(p => {

                return <div>

                    <h4 >{p.number}</h4>
                    <h5 >{p.name}</h5>
                    <h5 >{p.total}</h5>
                </div>
            })}
        </div>
    );
}
